export default {
    DRAWER: {
        IS_OPEN: 'drawer_is_open', //??
        OPEN: 'drawer_open',
        CLOSE: 'drawer_close',
        TOGGLE: 'drawer_toggle',
        ALWAYS_VISIBLE: 'always_visible'
    },
    SETTINGS: {
        CHANGED: 'settings_changed'
    },
    USER: {
        LOG_IN: 'user_login',
        CHANGED: 'user_changed',
        LOG_OUT: 'user_logout'
    },
    SCREENS: {
        ACTIVE_SCREEN_CHANGED: 'active_screen_changed'
    },
    CONFIRMATION: {
        OPEN: 'confirmation_open',
        CLOSE: 'confirmation_close'
    },
    //notification events
    SUCCESS: 'success',
    ERROR: 'error',
    WARNING: 'warning'
}
